import React from 'react';
import arrows from '../../images/background.svg';

const Background = () => {

    return(
        <div 
        style={{
            backgroundImage: `url(${arrows})`, 
            backgroundPosition: 'center', 
            backgroundSize: 'cover', 
            backgroundRepeat: 'no-repeat'
        }}/>
    )
};

export default Background;
